import {useState} from 'react';
import {Doctor} from '../../interface/doctor';

const Profile = () =>{

    const [user, setUser] = useState([]);
   
    const config = {
        headers:{
            Authorization:localStorage.getItem('token')
    }
    
}
    
    return (

        <div>
            <table className={'form'}>
                <thead>
                    <tr>
                    <th>ID</th>
                    <br/>
                    <th>NAME</th>
                    <br/>
                    <th>CRM</th>
                    <br/>
                    <th>CPF</th>
                    <br/>
                    </tr>
                </thead>

                    
                {user.map(
                    (p:Doctor) =>{
                    return(
                    <tr key={p.id}>
                        <th>4354354354</th>
                        <br/>
                        <th>fulaninho</th>
                        <br/>
                        <th>1996</th>
                        <br/>
                        <th>9421313313</th>
                        <br/>
                    </tr>    
                    )
                })}   
                        
            </table>
        </div>
    );
    }
export default Profile;
